import "./App.css";
import Home from "./components/Home";
import Profile from "./components/Profile";
import  Header  from '../components/Header';
import {
  BrowserRouter,
Route } from "react-router-dom";

function App() {
  return (
    <>
    <BrowserRouter>
    <Header  />
       <Switch>
          <Route path="H/">
            <Home />
          </Route>
          
        </Switch>
        </BrowserRouter>

      {/* <Home Home={Home} />
      <Profile Profile={Profile} /> */}
    </>
  );
}

export default App;
